import { Container } from '../Header/style';
import Logo from '../../assets/img_logo.png';
const Header: React.FC = () => {
  return (
    <Container id="header">
      < img id="logo" src={Logo} alt="TMB"  />

    </Container>


  );
}

export default Header;
